import React from 'react'
import { Navigate, Outlet } from 'react-router-dom'

function PrivateRoutes({isAdmin}) {
  if(isAdmin){
    return (
        <>
            <Outlet/>
        </>
      )
  }else{
    return <Navigate to={"/"}/>
  }
}

export default PrivateRoutes
